import React from "react"
import "../styles/fitaboServices.css"
import fitaboServices from "../data/FitaboServices.json"

export default function FitaboServices() {

  return (
    <section className="serviceWrapper">
      {fitaboServices.map((service, index) => (
        <div key={service.id} className={((index+1) % 2) === 0 ? "row" : "row reverse"}>
          <Img className="image" fluid={service.img.childImageSharp.fluid} alt={service.title} />
          <div className="details">
            <h2>{service.title}</h2>
            <p>{service.details}</p>
          </div>
        </div>
      ))}
    </section>
  )
}
